import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Log in to Facebook
    await page.waitForSelector('#email');
    await page.fill('#email', 'your_email@example.com'); // Replace with your email
    await page.fill('#password', 'your_password'); // Replace with your password
    await page.click('button.login-btn');
    await page.waitForLoadState('networkidle');

    // Take screenshot after login
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Navigate to profile page
    await page.waitForSelector('a[title="Profile"]'); // Adjust selector as necessary
    await page.click('a[title="Profile"]');
    await page.waitForLoadState('networkidle');

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_page.png'));

    // Download profile photo
    const profilePhotoUrl = await page.evaluate(() => {
      const img = document.querySelector('img[alt="Profile picture"]'); // Adjust selector as necessary
      return img ? img.src : null;
    });

    if (profilePhotoUrl) {
      const response = await page.goto(profilePhotoUrl);
      const buffer = await response.body();
      const fs = require('fs');
      fs.writeFileSync(path.join(screenshotsDir, 'profile_photo.png'), buffer);
    }

    return {
      success: true,
      action: "Downloaded profile photo successfully",
      extractedData: { profilePhotoUrl },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

